webMI.addOnload(function(e) {

	var id = "icon"+webMI.query["icon"];	
	webMI.gfx.setVisible(id, true);	

	webMI.addEvent(id, "click", function(e) {
	var background = this.parentNode.parentNode.children[3];
	console.log(e)
	var value = true;
		if (value == true) {
			this.setAttribute("fill", "#ffffff");
			webMI.display.openDisplay(webMI.query["display"],webMI.query,webMI.query["frame"]);
			} 
			});


	webMI.addEvent(id, "mouseover", function(e) {
	var background = this.parentNode.parentNode.children[3];
	console.log(e)
	var value = true;
		if (value == true)		
			this.setAttribute("fill", "#c3c3cf");
			background.setAttribute("fill", "#c3c3cf");
			});

	webMI.addEvent(id, "mouseout", function(e) {
	console.log(e)
	var background = this.parentNode.parentNode.children[3];
	var value = true;
		if (value == true) {
			this.setAttribute("fill", "#c3c3cf");
			background.setAttribute("fill", "#2e2d3d");}

			});


});


